import * as React from 'react';
import { Box, AppBar, Toolbar, IconButton, Typography, Menu, Container, Avatar, Button, Tooltip, MenuItem, Divider, Stack } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import AdbIcon from '@mui/icons-material/Adb';
import ExploreIcon from '@mui/icons-material/Explore';
import StorefrontRoundedIcon from '@mui/icons-material/StorefrontRounded';
import Groups2RoundedIcon from '@mui/icons-material/Groups2Rounded';
import './AppBar.css'

const pages = ['Discover', 'Market place', 'Clubs'];
const settings = ['Profile', 'Account', 'Dashboard', 'Logout'];

function ResponsiveAppBar() {
    const [anchorElNav, setAnchorElNav] = React.useState(null);
    const [anchorElUser, setAnchorElUser] = React.useState(null);

    const handleOpenNavMenu = (event) => {
        setAnchorElNav(event.currentTarget);
    };
    const handleOpenUserMenu = (event) => {
        setAnchorElUser(event.currentTarget);
    };

    const handleCloseNavMenu = () => {
        setAnchorElNav(null);
    };

    const handleCloseUserMenu = () => {
        setAnchorElUser(null);
    };

    return (
        <AppBar position="static" sx={{ backgroundColor: '#ffffff' }} elevation={0}>
            <Container maxWidth="xl">
                <Box sx={{ width: '80%', mx: 'auto' }}>
                    <Toolbar disableGutters >
                        <Typography
                            variant="h4"
                            noWrap
                            component="a"
                            href="/"
                            sx={{
                                mr: 2,
                                display: { xs: 'none', md: 'flex' },
                                fontFamily: 'Open Sans',
                                fontWeight: 900,
                                letterSpacing: '.1.5rem',
                                color: '#768A54',
                                textDecoration: 'none',
                            }}
                        >
                            <img src=".\susita_logo_name.png" width={'170px'} height='auto' />
                        </Typography>

                        <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
                            <IconButton
                                size="large"
                                aria-label="account of current user"
                                aria-controls="menu-appbar"
                                aria-haspopup="true"
                                onClick={handleOpenNavMenu}
                                color="inherit"
                            >
                                <MenuIcon />
                            </IconButton>
                            <Menu
                                id="menu-appbar"
                                anchorEl={anchorElNav}
                                anchorOrigin={{
                                    vertical: 'bottom',
                                    horizontal: 'left',
                                }}
                                keepMounted
                                transformOrigin={{
                                    vertical: 'top',
                                    horizontal: 'left',
                                }}
                                open={Boolean(anchorElNav)}
                                onClose={handleCloseNavMenu}
                                sx={{
                                    display: { xs: 'block', md: 'none' },
                                }}
                            >
                                {pages.map((page) => (
                                    <MenuItem key={page} onClick={handleCloseNavMenu}>
                                        <Typography sx={{ color: '#626262' }} textAlign="center">{page}</Typography>
                                    </MenuItem>
                                ))}
                            </Menu>
                        </Box>
                        <AdbIcon sx={{ display: { xs: 'flex', md: 'none' }, mr: 1 }} />
                        <Typography
                            variant="h5"
                            noWrap
                            component="a"
                            href=""
                            sx={{
                                mr: 2,
                                display: { xs: 'flex', md: 'none' },
                                flexGrow: 1,
                                fontFamily: 'Open Sans',
                                fontWeight: 700,
                                letterSpacing: '.3rem',
                                color: 'inherit',
                                textDecoration: 'none',
                            }}
                        >
                            LOGO
                        </Typography>
                        <Box sx={{ justifyContent: 'flex-end', marginRight: '20%', flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
                            <Stack direction="row" spacing={0}>
                                <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                                    <Button className="Button:hover"
                                    startIcon = {<ExploreIcon 
                                    sx={{ mt: '15px' }} />}
                                        onClick={handleCloseNavMenu}
                                        sx={{
                                            px: 3, pt: 0, mb: 2, color: '#828282', display: 'block', fontFamily: 'Open Sans', fontWeight: 300,
                                            letterSpacing: '.0.5rem', textTransform: 'none'
                                        }}
                                    >
                                        Discover
                                    </Button>
                                </Box>
                                <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                                    <StorefrontRoundedIcon className="Button:hover"
                                        sx={{ fontSize: '25px', color: '#828282', mt: '15px' }} />
                                    <Button className="Button:hover"
                                        onClick={handleCloseNavMenu}
                                        sx={{
                                            px: 3, pt: 0, mb: 2, color: '#828282', display: 'block', fontFamily: 'Open Sans', fontWeight: 300,
                                            letterSpacing: '.0.5rem', textTransform: 'none'
                                        }}
                                    >
                                        Market place
                                    </Button>
                                </Box>
                                <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                                    <Groups2RoundedIcon className="Button:hover"
                                        sx={{ fontSize: '25px', color: '#828282', mt: '15px' }} />
                                    <Button className="Button:hover"
                                        onClick={handleCloseNavMenu}
                                        sx={{
                                            px: 3, pt: 0, mb: 2, color: '#828282', display: 'block', fontFamily: 'Open Sans', fontWeight: 300,
                                            letterSpacing: '.0.5rem', textTransform: 'none'
                                        }}
                                    >
                                        Clubs
                                    </Button>
                                </Box>
                            </Stack>
                            {/* {pages.map((page, index) => (
                                <Box key={page} sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                                    {index == 0 ? <ExploreIcon sx={{ fontSize: '25px', color: '#828282', mt: '15px' }} /> : null}
                                    {index == 1 ? <StorefrontRoundedIcon sx={{ fontSize: '25px', color: '#828282', mt: '15px' }} /> : null}
                                    {index == 2 ? <Groups2RoundedIcon sx={{ fontSize: '25px', color: '#828282', mt: '15px' }} /> : null}
                                    <Button className="Button:hover"
                                        onClick={handleCloseNavMenu}
                                        sx={{
                                            px: 3, pt: 0, mb: 2, color: '#828282', display: 'block', fontFamily: 'Open Sans', fontWeight: 300,
                                            letterSpacing: '.0.5rem', textTransform: 'none'
                                        }}
                                    >
                                        {page}
                                    </Button>
                                </Box>
                            ))} */}
                            <Divider orientation="vertical" variant="middle" flexItem sx={{ borderRightWidth: 2, height: '40px', alignSelf: 'center' }} />
                        </Box>
                        <Box sx={{ flexGrow: 0 }}>
                            <Tooltip title="Open settings">
                                <IconButton onClick={handleOpenUserMenu} sx={{ p: 0 }}>
                                    <Avatar alt="Remy Sharp" src="/static/images/avatar/2.jpg" />
                                </IconButton>
                            </Tooltip>
                            <Menu
                                id="menu-appbar"
                                anchorEl={anchorElUser}
                                anchorOrigin={{
                                    vertical: 'bottom',
                                    horizontal: 'left',
                                }}
                                keepMounted
                                transformOrigin={{
                                    vertical: 'top',
                                    horizontal: 'left',
                                }}
                                open={Boolean(anchorElUser)}
                                onClose={handleCloseUserMenu}
                            >
                                {settings.map((setting) => (
                                    <MenuItem key={setting} onClick={handleCloseUserMenu}>
                                        <Typography textAlign="center">{setting}</Typography>
                                    </MenuItem>
                                ))}
                            </Menu>
                        </Box>
                    </Toolbar>
                </Box>
            </Container>
        </AppBar>
    );
}
export default ResponsiveAppBar;
